import React from "react";

function Header() {
  return (
    <div className="menu">
      <ul>
        <li className="logo">LOGO</li>
        <li className="search">SEARCH</li>
        <li className="login">GİRİŞ YAP</li>
        <li className="addProduct">İLAN VER</li>
      </ul>
    </div>
  );
}

export default Header;
